import './App.css';
import Login from './components/sessions/Login'
import UserHomepage from './components/user_components/UserHomepage'
import {useState} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom"




function App() {

  const [loggedIn, setLoggedIn ] = useState(true)


  return (
    <BrowserRouter>
      <Routes>
        <div className="App">
          {loggedIn ? 
            <Route path="homepage" element={<UserHomepage isLoggedIn={setLoggedIn} /> } />
              : 
            <Route path="login" element={<Login  isLoggedIn={setLoggedIn} />} />

          }
        </div>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
